VALUES
	(1,1,'2019-05-02 09:26:43','2019-05-02 09:26:43','<div id=\"bannerR\">\r\n<div id=\"div-gpt-ad-1474537762122-3\" data-google-query-id=\"CKGp9tm__-ECFYP57QodfI4N7w\">\r\n<div id=\"google_ads_iframe_/15188745/Lipsum-Unit4_0__container__\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aliquam nunc lectus, fermentum at massa et, venenatis sagittis tellus. Donec et dolor diam. Curabitur semper tristique tellus eget pharetra. Mauris finibus cursus metus, id interdum nibh tincidunt sit amet. Nulla facilisi. Maecenas semper urna sit amet sapien viverra tristique. Duis pellentesque urna vel orci condimentum, sit amet dictum dolor rutrum. Sed eu libero ornare, imperdiet velit sit amet, laoreet nunc. Nullam a tristique est.</div>\r\n</div>\r\n</div>','Hello world!','','publish','open','open','','hello-world','','','2019-05-03 13:46:56','2019-05-03 13:46:56','',0,'http://metro.test/?p=1',0,'post','',1),
	(2,1,'2019-05-02 09:26:43','2019-05-02 09:26:43','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://metro.test/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2019-05-23 12:27:39','2019-05-23 12:27:39','',0,'http://metro.test/?page_id=2',0,'page','',0),
	(3,1,'2019-05-02 09:26:43','2019-05-02 09:26:43','<h2>Who we are</h2><p>Our website address is: http://metro.test.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-05-02 09:26:43','2019-05-02 09:26:43','',0,'http://metro.test/?page_id=3',0,'page','',0),
	(5,1,'2019-05-02 09:31:28','2019-05-02 09:31:28','<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nMetro \"[your-subject]\"\nMetro <wordpress@metro.test>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Metro (http://metro.test)\nadam@persona.studio\nReply-To: [your-email]\n\n0\n0\n\nMetro \"[your-subject]\"\nMetro <wordpress@metro.test>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Metro (http://metro.test)\n[your-email]\nReply-To: adam@persona.studio\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.','Contact form 1','','publish','closed','closed','','contact-form-1','','','2019-05-02 09:31:28','2019-05-02 09:31:28','',0,'http://metro.test/?post_type=wpcf7_contact_form&p=5',0,'wpcf7_contact_form','',0),
